import React, { useCallback } from "react";
import { formateDate, formateNum, formateNumToFixed } from './functions.js';

const withFormateData = (Component) => {
  return (props) => {
    const formateData = useCallback((data) => {
      const newData = [...data];
console.log(newData)
      // newData.map(el => {
        newData.temp = formateNum(newData.temp);
        newData.datetime = formateDate(newData.datetime);
        newData.pres = formateNum(newData.pres / 1.333);
        newData.wind_spd = formateNumToFixed(newData.wind_spd);

      //   return newData
      // })

      return newData;
    }, []);

    return <Component {...props} formateData={formateData} />
  }
}

export default withFormateData;
